import React from "react";
import logo from '../images/sapphirelogo.svg';
import { animateScroll as scroll } from "react-scroll";
import Services from './Tabs/Services';
import About from './Tabs/About';
import Philantrophy from './Tabs/Philantrophy';


const scrollToTop = () => { scroll.scrollToTop() }

const Navbar = () => {
  return (
    <nav className="top-bar nav">
      <img
        src={logo}
        className="nav-logo small-1 medium-1 large-1"
        alt="Logo"
        onClick={scrollToTop}
      />
      <div className='title-bar-right'></div>
      {/* <ul className="nav-items small-11 medium-11 large-11">
        <Services />
        <About />
        <Philantrophy />
      </ul> */}
    </nav>
  );
}

export default Navbar;
